ザ・ランドレス　the Laundress　
アイロンウォーター Classic　475ml<BR><hr><br><FONT size="+1" color="#FF0000"></FONT><BR>
<br>
アイロンウォーターはヨーロッパで人気のシンプルケアアイテム。<br>スチームアイロンの水タンクにキャップ1杯入れてアイロンがけをすれば、衣類をフレッシュな香りに仕上げることができます。<br><br>

クラシック:ランドレスを象徴する香り。<br>サンダルウッドを基調としたスイートムスク、 イランイラン、シトラスなどのブレンドです。清潔感のある香り。
<br><br>

キャップ一杯と水をアイロンのスチーム用タンクに入れてください。<BR>キャップ1杯ずつ使った場合、約66回使用できます。<BR>
　
