衣類、帽子、バッグの中やスニーカー、ベッドファブリックやカーテン、布製のソファなどニオイの気になるところにシュッとするだけでお好みの香りにリフレッシュできるミスト。<br>抗菌・消臭効果があり、洗う回数を抑えたい大切な衣類や気分をリフレッシュさせたいときにもぴったりです。<br><br>
クラシック:ランドレスを象徴する香り。スイートムスク、イランイラン、シトラス、パチョリ。<br><br>

